
;(function(){
  const originalFetch = window.fetch;
  window.fetch = async function(...args) {
    const response = await originalFetch.apply(this, args);
    const url = (args[0] || '').toString();
    
    // Login endpoint-ін exclude ету
    if (url.includes('/auth/login')) {
      return response;
    }
    
    // Тек API сұраныстары үшін 401 check
    if (response.status === 401 && url.includes('/api/')) {
      // Session expired - logout
      document.cookie = '.ASPXAUTH=; expires=Thu, 01 Jan 1970 00:00:00 UTC; path=/;';
      document.cookie = 'ASP.NET_SessionId=; expires=Thu, 01 Jan 1970 00:00:00 UTC; path=/;';
      alert('Сессия мерзімі бітті. Қайта кіріңіз. / Сессия истекла. Войдите снова. / Session expired. Please log in again.');
      window.location.href = '/login';
    }
    return response;
  };
})();

;(function(){
  // Session expired модал стильдері
  const modalStyles = `
    .session-modal-overlay {
      position: fixed;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      background: rgba(0, 0, 0, 0.7);
      display: flex;
      align-items: center;
      justify-content: center;
      z-index: 99999;
      backdrop-filter: blur(5px);
    }
    .session-modal {
      background: linear-gradient(135deg, #1a1a2e 0%, #16213e 100%);
      border-radius: 16px;
      padding: 32px;
      max-width: 400px;
      width: 90%;
      box-shadow: 0 20px 60px rgba(0, 0, 0, 0.5);
      color: white;
      font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
    }
    .session-modal h2 {
      margin: 0 0 8px 0;
      font-size: 24px;
      color: #ff6b6b;
    }
    .session-modal p {
      margin: 0 0 24px 0;
      color: #a0a0a0;
      font-size: 14px;
    }
    .session-modal input {
      width: 100%;
      padding: 14px 16px;
      margin-bottom: 12px;
      border: 2px solid #2d3748;
      border-radius: 10px;
      background: #0d1117;
      color: white;
      font-size: 16px;
      box-sizing: border-box;
      transition: border-color 0.2s;
    }
    .session-modal input:focus {
      outline: none;
      border-color: #4299e1;
    }
    .session-modal button {
      width: 100%;
      padding: 14px;
      border: none;
      border-radius: 10px;
      font-size: 16px;
      font-weight: 600;
      cursor: pointer;
      transition: transform 0.1s, opacity 0.2s;
    }
    .session-modal button:active {
      transform: scale(0.98);
    }
    .session-modal .btn-login {
      background: linear-gradient(135deg, #4299e1 0%, #3182ce 100%);
      color: white;
      margin-bottom: 8px;
    }
    .session-modal .btn-login:disabled {
      opacity: 0.6;
      cursor: not-allowed;
    }
    .session-modal .btn-logout {
      background: transparent;
      color: #a0a0a0;
      border: 1px solid #2d3748;
    }
    .session-modal .error-msg {
      color: #ff6b6b;
      font-size: 13px;
      margin-bottom: 12px;
      display: none;
    }
  `;

  // Модал HTML
  function showSessionModal() {
    if (document.getElementById('session-modal-overlay')) return;
    
    const styleEl = document.createElement('style');
    styleEl.textContent = modalStyles;
    document.head.appendChild(styleEl);
    
    const overlay = document.createElement('div');
    overlay.id = 'session-modal-overlay';
    overlay.className = 'session-modal-overlay';
    overlay.innerHTML = `
      <div class="session-modal">
        <h2>⏰ Сессия мерзімі бітті</h2>
        <p>Жұмысты жалғастыру үшін қайта кіріңіз</p>
        <div class="error-msg" id="session-error"></div>
        <input type="text" id="session-login" placeholder="Логин" autocomplete="username">
        <input type="password" id="session-password" placeholder="Құпия сөз" autocomplete="current-password">
        <button class="btn-login" id="session-submit">Кіру</button>
        <button class="btn-logout" id="session-logout">Шығу</button>
      </div>
    `;
    document.body.appendChild(overlay);
    
    // Event listeners
    document.getElementById('session-submit').onclick = async () => {
      const login = document.getElementById('session-login').value;
      const password = document.getElementById('session-password').value;
      const btn = document.getElementById('session-submit');
      const error = document.getElementById('session-error');
      
      if (!login || !password) {
        error.textContent = 'Логин мен құпия сөзді енгізіңіз';
        error.style.display = 'block';
        return;
      }
      
      btn.disabled = true;
      btn.textContent = 'Күте тұрыңыз...';
      error.style.display = 'none';
      
      try {
        const univerCode = document.cookie.match(/univer_code=([^;]+)/)?.[1] || 'kstu';
        const res = await window._originalFetch('/auth/login', {
          method: 'POST',
          headers: {'Content-Type': 'application/json'},
          body: JSON.stringify({username: login, password: password, univer: univerCode})
        });
        
        if (res.ok) {
          overlay.remove();
          styleEl.remove();
          // Беттегі деректерді жаңарту
          window.location.reload();
        } else {
          const data = await res.json();
          error.textContent = data.error || 'Қате логин немесе құпия сөз';
          error.style.display = 'block';
          btn.disabled = false;
          btn.textContent = 'Кіру';
        }
      } catch (e) {
        error.textContent = 'Байланыс қатесі. Қайталап көріңіз.';
        error.style.display = 'block';
        btn.disabled = false;
        btn.textContent = 'Кіру';
      }
    };
    
    document.getElementById('session-logout').onclick = () => {
      document.cookie = '.ASPXAUTH=; expires=Thu, 01 Jan 1970 00:00:00 UTC; path=/;';
      document.cookie = 'ASP.NET_SessionId=; expires=Thu, 01 Jan 1970 00:00:00 UTC; path=/;';
      window.location.href = '/login';
    };
    
    // Enter key
    document.getElementById('session-password').onkeypress = (e) => {
      if (e.key === 'Enter') document.getElementById('session-submit').click();
    };
  }

  // Fetch interceptor
  window._originalFetch = window.fetch;
  window.fetch = async function(...args) {
    const response = await window._originalFetch.apply(this, args);
    if (response.status === 401) {
      const url = String(args[0] || '');
      if (url.includes('/api/') && !url.includes('/auth/')) {
        showSessionModal();
      }
    }
    return response;
  };
})();


